@import url('https://fonts.googleapis.com/css?family=Aclonica');

body {
  background-color: lightgray;
  font-family: 'Aclonica', sans-serif;
  margin: 100px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-content: center;
}

#submit {
  margin-left: 10px;
}

#next {
  margin-top: 25px;
  width: 200px;
  align-self: center;
}

#inputRow {
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-content: center;
}

table {
  margin: 0 auto;
  margin-top: 15px;
  font-family: "Trebuchet MS", Arial, Helvetica, sans-serif;
  border-collapse: collapse;
  table-layout: fixed;
  overflow: hidden;
  width: 50%;
}

table td, table th {
  width: 25px;
  border: 1px solid #ddd;
  padding: 8px;
}

table tr:nth-child(even){background-color: #f2f2f2;}

table th {
  padding-top: 12px;
  padding-bottom: 12px;
  text-align: left;
  background-color:#79a0e0;
  color: white;
}

#header {
  text-align: center;
}

input {
  width: 100px;
}

label {
  padding-left: 10px;
  padding-right: 10px;
}
